import React, { useEffect, useState } from "react";
import { Link as ScrollLink } from "react-scroll";
import { Link, useHistory, useRouteMatch } from "react-router-dom";
// import userRequest from "../../pages/userRequests";
import {
  FaTwitter,
  FaInstagram,
  FaYoutube,
  FaLinkedin,
  // SiLinktree
} from "react-icons/fa";
import SiLinktree from "react-icons";
// import Button from "@mui/material/Button";

const headerData = {
  name: "Nathan Foss",
  designation: "Web Developer",
  imageThumb: "/images/headshot.png",
  social: {
    facebook: "https://facebook.com",
    twitter: "https://twitter.com",
    instagram: "https://www.instagram.com/",
    youtube: "https://www.youtube.com/",
    dribbble: "https://dribbble.com/",
  },
};

function Header({ toggleHeader, toggleHandler }) {
  // const [currentUser, setCurrentUser] = useState(false);
  const history = useHistory();

  const [currentPath, setCurrentPath] = useState("");
  const match = useRouteMatch();

  // useEffect(() => {
  //   setCurrentPath(match.path);
  // }, [match]);

  // useEffect(() => {
  //   userRequest
  //     .get("/user/")
  //     .then((response) => {
  //       setCurrentUser(true);
  //     })
  //     .catch((notLoggedIn) => {
  //       console.log("Not logged in");
  //       setCurrentUser(false);
  //     });
  // }, []);

  // const logoutHandler = (e) => {
  //   e.preventDefault();
  //   try {
  //     userRequest
  //       .post("/logout/", { withCredentials: true })
  //       .then(() => {
  //         // Request successful
  //         console.log("logout success");
  //         history.push("/");
  //         setCurrentUser(false);
  //       })
  //       .catch((error) => {
  //         // Request failed, handle the error
  //         console.log(error);
  //       });
  //   } catch (error) {
  //     console.log(error);
  //   }
  // };
  return (
    <>
      <div
        className={
          toggleHeader
            ? "mobile-header py-2 px-3 mt-4 push"
            : "mobile-header py-2 px-3 mt-4"
        }
      >
        <button className="menu-icon mr-2" onClick={toggleHandler}>
          <span></span>
          <span></span>
          <span></span>
        </button>
        {/* <Link to="/" className="logo" >
          <img  src={headerData.imageThumb} alt={headerData.name} />
        </Link> */}
        <Link to="/" className="site-title dot ml-2">
          {headerData.name}
        </Link>
      </div>

      <header
        className={
          toggleHeader
            ? "left float-left shadow-dark open"
            : "left float-left shadow-dark"
        }
      >
        <button
          type="button"
          className="close"
          aria-label="Close"
          onClick={toggleHandler}
        >
          <span aria-hidden="true">&times;</span>
        </button>
        <div className="header-inner d-flex align-items-start flex-column">
          <Link to="/">
            <img
              style={{ marginTop: "-20%", clipPath: "circle()" }}
              src={headerData.imageThumb}
              alt={headerData.name}
            />
          </Link>
          {/* <Link to="/" className="site-title dot mt-3">
            {headerData.name}
          </Link> */}

          {/* <span className="site-slogan">{headerData.designation}</span> */}

          <nav style={{ marginTop: "-15%", marginBottom: "0%" }}>
            <ul className="vertical-menu scrollspy">
              <li>
                {currentPath === "/" ? (
                  <ScrollLink
                    activeClass="active"
                    to="section-home"
                    spy={true}
                    smooth={true}
                    offset={-50}
                    duration={500}
                  >
                    <i className="icon-home"></i>Home
                  </ScrollLink>
                ) : (
                  <Link to="/">
                    <i className="icon-home"></i>Home
                  </Link>
                )}
              </li>
              <li>
                {currentPath === "/" ? (
                  <ScrollLink
                    activeClass="active"
                    to="section-about"
                    spy={true}
                    smooth={true}
                    offset={-50}
                    duration={500}
                  >
                    <i className="icon-user"></i>About
                  </ScrollLink>
                ) : (
                  <Link to="/">
                    <i className="icon-user"></i>About
                  </Link>
                )}
              </li>
              <li>
                {currentPath === "/" ? (
                  <ScrollLink
                    activeClass="active"
                    to="section-services"
                    spy={true}
                    smooth={true}
                    offset={-50}
                    duration={500}
                  >
                    <i className="icon-bulb"></i>Skills
                  </ScrollLink>
                ) : (
                  <Link to="/">
                    <i className="icon-bulb"></i>Skills
                  </Link>
                )}
              </li>
              <li>
                {currentPath === "/" ? (
                  <ScrollLink
                    activeClass="active"
                    to="section-experiences"
                    spy={true}
                    smooth={true}
                    offset={-50}
                    duration={500}
                  >
                    <i className="icon-graduation"></i>Resume
                  </ScrollLink>
                ) : (
                  <Link to="/">
                    <i className="icon-graduation"></i>Resume
                  </Link>
                )}
              </li>
              <li>
                {currentPath === "/" ? (
                  <ScrollLink
                    activeClass="active"
                    to="section-portfolios"
                    spy={true}
                    smooth={true}
                    offset={-50}
                    duration={500}
                  >
                    <i className="icon-grid"></i>Projects
                  </ScrollLink>
                ) : (
                  <Link to="/">
                    <i className="icon-grid"></i>Projects
                  </Link>
                )}
              </li>
              {/* <li>
                {currentPath === "/" ? (
                  <ScrollLink
                    activeClass="active"
                    to="section-blogs"
                    spy={true}
                    smooth={true}
                    offset={-50}
                    duration={500}
                  >
                    <i className="icon-pencil"></i>Blog
                  </ScrollLink>
                ) : (
                  <Link to="/">
                    <i className="icon-pencil"></i>Blog
                  </Link>
                )}
              </li> */}
            </ul>
          </nav>

          <div className="footer mt-auto" style={{ marginBottom: "30%" }}>
            <ul className="social-icons list-inline">
              {!headerData.social.facebook ? null : (
                <li className="list-inline-item">
                  <a href={headerData.social.facebook}>
                    <FaLinkedin />
                  </a>
                </li>
              )}
              {!headerData.social.twitter ? null : (
                <li className="list-inline-item">
                  <a href={headerData.social.twitter}>
                    <FaTwitter />
                  </a>
                </li>
              )}
              {!headerData.social.instagram ? null : (
                <li className="list-inline-item">
                  <a href={headerData.social.instagram}>
                    <FaInstagram />
                  </a>
                </li>
              )}
              {!headerData.social.youtube ? null : (
                <li className="list-inline-item">
                  <a href={headerData.social.youtube}>
                    <FaYoutube />
                  </a>
                </li>
              )}
              {!headerData.social.dribbble ? null : (
                <li className="list-inline-item">
                  <a href={headerData.social.dribbble}>
                    <SiLinktree />
                  </a>
                </li>
              )}
            </ul>
            {/* {currentUser && <Button
              onClick={logoutHandler}
              color="secondary"
              variant="contained"
            >
              Log out
            </Button>} */}
            <span className="copyright">
              &copy; {new Date().getFullYear()} nathanfoss.dev
            </span>
          </div>
        </div>
      </header>
    </>
  );
}

export default Header;
